function Stock(productsArray) {
  console.log("probando", productsArray.productsArray)
  return (
    <table>
      <thead>
        <tr>
          <th>Id</th>
          <th>NombreProducto</th>
          <th>Cantidad</th>
          <th>precio</th>
          <th>minStock</th>
        </tr>
      </thead>
      <tbody>
      {productsArray.productsArray.map(element => {
        element.map((product) => (
          <tr key={product.id}>
            <td>{product.id}</td>
            <td>{product.name}</td>
            <td>{product.quantity}</td>
            <td>{product.price}</td>
            <td>{product.minStock}</td>
          </tr>
        ))}
      )}
    </tbody>
  </table>
)}

export default Stock;
